                    gridLines: {
                        display: false
                    },
                    barPercentage: 0.7,
                    categoryPercentage: 0.6,
                    ticks: {
                        fontFamily: "'Rubik', sans-serif",
                        fontSize: 13,
                        fontColor: '#8392a5'
                    }
